const tabela = document.getElementById('tabelaDados');
const searchInput = document.getElementById('searchInput');
const filterUF = document.getElementById('filterUF');
const filterMunicipio = document.getElementById('filterMunicipio');

// Carrega a tabela
function carregarTabela(lista) {
    tabela.innerHTML = '';
    lista.forEach(item => {
        const tr = document.createElement('tr');
        tr.innerHTML = `
            <td>${String(item.UF || '')}</td>
            <td>${String(item.municipio || '')}</td>
            <td>${String(item.dataSolic || '')}</td>
            <td>${String(item.função || '')}</td>
            <td>${String(item.nome || '')}</td>
            <td>${String(item.contato || '')}</td>
            <td>${String(item.email || '')}</td>
            <td>${String(item.status || '')}</td>
            <td>${String(item.dataAlt || '')}</td>
            <td>${String(item.pci || '')}</td>
            <td>${String(item.obs || '')}</td>
            <td><a href="${String(item.oficio || '#')}" target="_blank">Ver Ofício</a></td>
        `;
        tabela.appendChild(tr);
    });
}

// Carrega UFs no select
function carregarUFs() {
    filterUF.innerHTML = '<option value="">Selecionar UF</option>';
    const ufs = [...new Set(window.dados.map(d => (d.UF || '').trim().toUpperCase()))];
    ufs.forEach(uf => {
        if (uf) {
            const option = document.createElement('option');
            option.value = uf;
            option.textContent = uf;
            filterUF.appendChild(option);
        }
    });
}

// Carrega municípios dependendo da UF selecionada
function carregarMunicipios(ufSelecionada) {
    filterMunicipio.innerHTML = '<option value="">Selecionar Município</option>';
    if (!ufSelecionada) return;
    const municipios = [...new Set(
        window.dados
            .filter(d => (d.UF || '').trim().toUpperCase() === ufSelecionada)
            .map(d => (d.municipio || '').trim())
    )];
    municipios.forEach(m => {
        if (m) {
            const option = document.createElement('option');
            option.value = m;
            option.textContent = m;
            filterMunicipio.appendChild(option);
        }
    });
}

// Aplica filtros de busca e selects
function aplicarFiltros() {
    const termo = searchInput.value.toLowerCase();
    const uf = filterUF.value;
    const municipio = filterMunicipio.value;
    const filtrados = window.dados.filter(item => {
        const ufItem = (item.UF || '').trim().toUpperCase();
        const municipioItem = (item.municipio || '').trim();
        return (
            (uf === '' || ufItem === uf) &&
            (municipio === '' || municipioItem === municipio) &&
            Object.values(item).some(valor => String(valor || '').toLowerCase().includes(termo))
        );
    });
    carregarTabela(filtrados);
}

// Eventos
filterUF.addEventListener('change', () => {
    carregarMunicipios(filterUF.value);
    aplicarFiltros();
});
filterMunicipio.addEventListener('change', aplicarFiltros);
searchInput.addEventListener('input', aplicarFiltros);

// Inicialização
carregarUFs();
carregarTabela(window.dados);